description:
Teen Titans Go!

This follow-up to the popular &quot;Teen Titans&quot; series takes a more comedic look at the superheroes, showing what life is like for the teens when their capes come off. Funny things happen to Robin, Starfire, Raven, Beast Boy and Cyborg between saving the world and being regular teens, living together without adult supervision. The teens, in their ordinary lives, deal with the everyday issues of adolescence that include such important things as having staring contests to determine who does the laundry and going on a series of quests to construct the perfect sandwich. But, of course, the heroes still fight crime in Jump City when the need arises. Whatever the situation, they're always ready for an adventure -- inside the house or out of it.
First episode date: April 23, 2013
Network: Cartoon Network
